import React, { Component } from 'react';
import './App.css';
import Navbar from './components/Layout/Navbar';
import Footer from './components/Layout/Footer';
import {Route, BrowserRouter} from 'react-router-dom';
import Home from './components/Home';
import Rooms from './components/Rooms/Rooms';
import Summary from './components/Summary/Summary';
import Settings from './components/Settings/Settings';

class App extends Component{
  constructor(props){
    super(props);
    this.state={
      hello:"world"
    }
  }


  render(){
    const {status} = this.state;
    return (
      <BrowserRouter>
        <div>
          <Navbar />
          <Route path='/' exact component={Home} status={status}/>
          <Route path='/summary' exact component={Summary} status={status}/>
          <Route path='/rooms' exact component={Rooms} status={status}/>
          <Route path='/settings' exact component={Settings} status={status}/>
          <Footer/>
        </div>
      </BrowserRouter>

    );
  }
}

export default App;
